import React from "react";
import './contact.css';
import { useState } from "react";

function Form(){
    return(
        <form action="POST">
            <input type="text" name="name" id="name" placeholder="Name"/>
            <input type="email" id="email" placeholder="Email"/>
            <input type="text" id="message" placeholder="Message"/>
            <button>Send</button>
        </form>
    )
}

export default Form;
